import React, {Component} from 'react'
import {Link, BrowserRouter as Route} from 'react-router-dom'

class Navbar extends Component{
    render(){
        return(
            <div className="App">
                <hr/>
                    <h2 style={navTextStyling}>News Products Login <Link to="/register">Register</Link></h2>
                <hr/> 
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}

export default Navbar;
